import React, { useState } from 'react'
import { View, Text } from 'react-native'
import style from './style.js'

export default function Home({ navigation, route }) {
    const { id, nome } = route.params;



    return (
        <View>
            <View>
                <Text>{id}</Text>
                <Text>{nome}</Text>
            </View>
        </View>
    )
}
